import React from "react";
import "./Home.css"
import { useState, useCallback } from "react";

const Home = () => {
const {value, setValue} = useState();

  return (
    <>
      <h1>Homepage</h1>
      <input value={value} onChange={(e)=> setValue(e.target.value)}>Hello</input>
    </>
  )

};

export default Home;
